async function retrievePhoneNumber(user: { email: string | null }) {
    if (!user.email) {
        console.error('Email is null');
        return null;
    }
    const email = user.email; // The user's email
    const db = firebase.firestore(); // Get Firestore instance

    try {
        // Query the database for the user document with the matching email
        const usersRef = db.collection('users');
        const querySnapshot = await usersRef.where('email', '==', email).get();

        if (!querySnapshot.empty) {
            // Assuming the email field is unique and will return only one document
            const userDoc = querySnapshot.docs[0];
            return userDoc.data().phone; // Return the phone number from the document
        } else {
            console.error('No user found with that email');
            return null; // No user found
        }
    } catch (error) {
        console.error('Error retrieving phone number:', error);
        return null; // Return null in case of error
    }
}

async function retrieveUserType(userId: string) {
    const db = firebase.firestore();
    try {
        const userDoc = await db.collection('users').doc(userId).get();
        if (userDoc.exists) {
            return userDoc.data()?.userType;
        } else {
            console.error('User document not found for user ID:', userId);
            return null;
        }
    } catch (error) {
        console.error('Error retrieving user type:', error);
        return null;
    }
}

